import './App.css';
import React, { useState } from "react";
import Axios from 'axios';
import {BrowserRouter as Router, Routes,Route, Redirect, Link} from 'react-router-dom';
import maini from './maini';

function App() {

  const [post, setPost] = useState({});
  const [resumeid, id1] = useState('');
  const [resumename, name1] = useState('');
  const [resumeus, usn] = useState('');
  const [resumehdeg, hdeg] = useState('');
  const [resumejtype, jtype] = useState('');
  const [resumejdic, jdisc] = useState('');
  const [resumesslcp, sslcp] = useState('');
  const [resumesslcins, sslcins] = useState('');
  const [resumepucp, pucp] = useState('');
  const [resumepuci, puci] = useState('');
  const [resumedeg, deg] = useState('');
  const [resumedegp, degp] = useState('');
  const [resumedegi, degi] = useState('');

  const submitReview = () => {
    Axios.post("http://localhost:3001/postt", {
      resumename: resumename,
      resumeus: resumeus,
      resumehdeg: resumehdeg,
      resumejtype: resumejtype,
      resumejdic: resumejdic,
      resumesslcp: resumesslcp,
      resumesslcins: resumesslcins,
      resumepucp: resumepucp,
      resumepuci: resumepuci,
      resumedeg: resumedeg,
      resumedegp: resumedegp,
      resumedegi: resumedegi,

    }).then(() => {
      alert("sucessfully inserted")
    });
  };


  const submitReview1 = () => {
    Axios.post("http://localhost:3001/api", {
      resumeid: resumeid,
    }).then((response) => {
      console.log(response);
    });
  };

  return (

    <Router>
    <Routes>
      <Route exact path='./maini.js' component={maini}/>
    </Routes>
  </Router>

  )

}

export default App;
